import { useHistory } from 'react-router-dom';

function DefaultPage() {
    const history = useHistory();

    return(
        <div className="default-page">
            <button onClick={e => history.push('/deck-builder')}>Create New Deck</button>
            <button onClick={e => history.push('/deck-builder')}>Load Saved Deck</button>
        </div>
    )
}

export default DefaultPage;
